'use strict';
let queue = require('@gehtsoft/LuaxStdlib-node').queue;
class PriceTerminalCallbacksContainer {
    callbacks;
    constructor() {
        this.callbacks = new queue();
    }
    length() {
        return this.callbacks.length();
    }
    enqueue(callback) {
        this.callbacks.enqueue(callback);
    }
    clear() {
        while(this.callbacks.length() > 0) {
            this.callbacks.dequeue();
        }
    }
    onError(error) {
        while(this.callbacks.length() > 0) {
            this.callbacks.dequeue().onError(error);
        }
    }
    onSuccess(result) {
        while(this.callbacks.length() > 0) {
            this.callbacks.dequeue().onSuccess(result);
        }
    }
}
module.exports = PriceTerminalCallbacksContainer
